    INSERT INTO mastergroupdetail(KodeGroup, `Module`, Company, `Read`, Confirm, Entry, `Update`, `Delete`, Print, Export, Import, TanggalEntry, TanggalUpdate, UserId) 
    select pkodegroup, `module`, company, 0, 0, 0, 0, 0, 0, 0, 0, now(), now(), pUserId
