/* Procedure structure for procedure `sp_mastergroupdetail_get_all` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_mastergroupdetail_get_all` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sa`@`%` PROCEDURE `sp_mastergroupdetail_get_all`(in pKodeGroup      varchar(20),pCompany        varchar(20))
begin
    select
    sum(id) id,
    max(KodeGroup) KodeGroup,
    `Module`,
    max(Description) as modulename,
    max(Company) Company,
    sum(`Read`) `Read`,
    sum(Confirm) Confirm,
    sum(Entry) Entry,
    sum(`Update`) `Update`,
    sum(`Delete`) `Delete`,
    sum(Print) Print,
    sum(Export) Export,
    sum(Import) Import,
    max(TanggalEntry) TanggalEntry,
    max(TanggalUpdate) TanggalUpdate,
    max(UserId) UserId
    from (
    select
    0 id,
    '' KodeGroup,
    `Module`,
    Description,
    '' Company,
    0 `Read`,
    0 Confirm,
    0 Entry,
    0 `Update`,
    0 `Delete`,
    0 Print,
    0 Export,
    0 Import,
    '' TanggalEntry,
    '' TanggalUpdate,
    '' UserId
    from mastermodule
    union all
    select 
    id,
    KodeGroup,
    `Module`,
    '' Description,
    Company,
    `Read`,
    Confirm,
    Entry,
    `Update`,
    `Delete`,
    Print,
    Export,
    Import,
    TanggalEntry,
    TanggalUpdate,
    UserId
    from mastergroupdetail where kodegroup=pKodeGroup and company=pCompany
    ) as x
    group by `module`;
end */$$
DELIMITER ;

